import React, { Component } from "react";

function About() {
  return (
    <section id="about">
      <h2>About us</h2>
      <p class="team">
        We are a tech enthusiast team that provides drivers with the ability to
        create ride offers and passengers to join available ride offers through
        a new Ride My Way app.
      </p>
    </section>
  );
}

export default About;
